Verenigd Koninkrijk
Thriller
101 minuten

geregisseerd door Frank Falco
met Gary Daniels, Steven Elliot en Ben Shockley

In deze mysterieuze thriller moet Inspecteur Farrel de ontvoering van het meisje Dallas oplossen. Aanwijzingen wijzen opnieuw naar de onbekende dader die al eerder toegeslagen heeft. Farrel kon de zaak toen niet op tijd oplossen met de dood van een meisje tot gevolg. Hij raakt volkomen geobsedeerd en is vastberaden Dallas wel te vinden en de gruwelijke moordenaar voorgoed achter tralies te zetten. Hij komt onder steeds zwaardere druk te staan en als opeens de geest van het vorige slachtoffer voor hetm verschijnt begint ook Farrel zelf aan zijn verstand te twijfelen. En waarom achtervolgt zij hem? Is ze uit op wraak, omdat Farrel haar leven niet kon redden? Of wil ze juist voorkomen dat er nog een slachtoffer van de maniak valt? Mysterieuze en gewelddadige gebeurtenissen stapelen zich op....


